import "../style/Dropdown.css";

export default function Select(props) {
  return (
        <select className="button" id={props.id}>
          <option className="option" id="top" value="es">
            Espa√±ol
          </option>
          <option className="option" id="middle" value="es">
            Merge formatting
          </option>
          <option className="option" id="bottom" value="it">Italiano
            Keep text only
          </option>
        </select>
  );
}

